    false,nt"url": null,nt"notes": "This documents covers bird use of Port
    Valdez and Valdez Arm. Valdez Port is the sire of the Trans-Alaska Pipeline oil
    terminal. The objective of the surveys was to assess the extent of bird use in an
    area susceptible to environmental degradation from petroleum related development
    or events. A second objective was to collect wintering seas ducks for analysis of
    food habits in order to define habitat preference of an important component of the
    Prince William sound ecosystem. Methods, data analysis and results are discussed.",nt"license_title":
